import { Link } from "react-router-dom";

function Navbar() {
    const activeStyle = {
        backgroundColor: 'yourActiveColor',  // Replace 'yourActiveColor' with the color you want for clicked state
    };
    return (
        <>
            <nav className="navbar navbar-expand-lg bg-dark text-uppercase text-white">
                <div className="container-fluid p-4 mx-4">
                    <Link className="navbar-brand text-white fw-bold fs-2 ms-4" to="/">Start Framework</Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse ms-4" id="navbarNav">
                        <ul className="navbar-nav ms-auto"> 
                            <li className="nav-item">
                                <Link className="nav-link text-white fw-bold " activeStyle={activeStyle} to="/about">About</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link text-white fw-bold " to="/portfolio">Portfolio</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link text-white fw-bold " to="/contact">Contact</Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
